import React from "react";
import "./Home.css";
import Product from "./Product";

function Home(){
    return(
        <div className="home">
            <div className="home_container">
                <img className="home_image" src="https://raraa.s3-ap-southeast-1.amazonaws.com/raraa_home.png"></img>

                <div className="home_row">
                    <Product
                        id="001"
                        title="Palazzo Pants"
                        price={11.96}
                        rating={5}
                        image="https://instagram.fkul18-1.fna.fbcdn.net/v/t51.2885-15/e35/122040773_5111591178881625_1557227438738202353_n.jpg?_nc_ht=instagram.fkul18-1.fna.fbcdn.net&_nc_cat=109&_nc_ohc=fgN4djZ4akwAX8Ak620&_nc_tp=18&oh=bcb23dc98fc77505ffd1268eeaed5256&oe=5FB9858C"
                    />
                    <Product
                        id="002"
                        title="Short Pants With Drawstring - Black"
                        price={98.99}
                        rating={5}
                        image="https://media.very.co.uk/i/very/P6LTG_SQ1_0000000071_CHARCOAL_SLf?$300x400_retinamobilex2$"
                    />
                    <Product
                        id="003"
                        title="Mom Fit Long Jeans - Light Blue"
                        price={598.99}
                        rating={4}
                        image="https://images-na.ssl-images-amazon.com/images/I/816ctt5WV5L._AC_SX385_.jpg"
                    />
                </div>
                <div className="home_row">
                <Product
                    id="004"
                    title="Long Knit Culottes - Green"
                    price={1094.98}
                    rating={4}
                    image="https://images-na.ssl-images-amazon.com/images/I/6125mFrzr6L._AC_SX355_.jpg"
                />
                <Product
                    id="005"
                    title="Skort With Buckle - Black"
                    price={1094.98}
                    rating={4}
                    image="https://images-na.ssl-images-amazon.com/images/I/6125mFrzr6L._AC_SX355_.jpg"
                />
                <Product
                    id="006"
                    title="Short Jogger - Black"
                    price={1094.98}
                    rating={4}
                    image="https://images-na.ssl-images-amazon.com/images/I/6125mFrzr6L._AC_SX355_.jpg"
                />
                </div>
            </div>
        </div>
    )
}

export default Home;
